import posts from '../Posts/MyPosts.module.css';
import Wall from './Post/Post.jsx';

let postsData = [
    {name: 'Evgeniy', text: 'I need more React', like:'16'},
    {text: 'I love REACT!!!', like:'45'}
]

let postsElements = postsData.map(p =>  <Wall name={p.name} text={p.text} likeCount={p.like}/>)

function MyPosts() {
    return (
        <div className={posts.postsBlock}>
            <div className={posts.myP}>
                <h3>MyPosts</h3>
            </div>
            <div>
                <p className={posts.newP}>New Posts</p>
            </div>
            <div className={posts.wallPost}>
                {postsElements}
            </div>
        </div>
    );
}

export default MyPosts;
